import React, { useEffect } from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink } from 'react-router-dom';
export default function Header() {

    const findSessionUser=()=>{
        let sessionUser=JSON.parse(localStorage.getItem("session"));
        if(sessionUser){
            return true
        }
        return false;
    }
    const handleClick=()=>{
         let sessionUser=JSON.parse(localStorage.getItem("session"));
         if(sessionUser){
            localStorage.removeItem("session");
         }
    }
   

    return (
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <NavLink to={"/"}> <Navbar.Brand href="#home">Navbar</Navbar.Brand></NavLink>
                    <Nav className="me-auto">
                        console.log();
                        {findSessionUser()==true}?
                        <NavLink onClick={handleClick}>Sign Out</NavLink>:
                        <NavLink style={{ textDecoration: "none", color: "white" }} to={"/signIn"}>Sign In</NavLink>
                        <NavLink style={{ textDecoration: "none", color: "white" }} to={"/signUp"}>Sign Up</NavLink>
                     
                    </Nav>
                </Container>
            </Navbar>


        </>
    )
}
